Descripcion:
Que, el Hospital del Salvador necesita contar con la “Servicio de Mantenimiento Preventivo y Correctivo para Tomógrafo Axial Computarizado (TAC) marca Philips, modelo Ingenuity Core, por un periodo de doce (12) meses, perteneciente al Servicio de Imagenología del Hospital del Salvador”, con la finalidad de satisfacer de manera adecuada y eficiente la labor asistencial;

Que, esta institución busca las mejores condiciones del mercado, en cuanto a calidad técnica y precio para adquirir el “Servicio de Mantenimiento Preventivo y Correctivo para Tomógrafo Axial Computarizado (TAC) marca Philips, modelo Ingenuity Core, por un periodo de doce (12) meses, perteneciente al Servicio de Imagenología del Hospital del Salvador”

Que, por este servicio, se convocó a Licitación Publica ID 1057489-345-LQ25 mediante aprobación de bases por Resolución Exenta N°3059 de 31 de julio de 2025, la cual fue declarada desierta mediante Resolución Exenta N°3609 de 27 de agosto de 2025;
	
Que, por la cuantía determinada, la presente licitación se ubica en el tramo para contrataciones de aquellas iguales o superiores a 1.000 UTM e inferiores a 5.000 UTM, en conformidad al Artículo 36º del Reglamento de la Ley Nº19.886;

Que hechas las consultas respectivas, la provisión de estos bienes o servicios no se encuentra disponible por Convenios Marcos ofrecidos en el Sistema de Información de la Dirección de Compras, www.mercadopublico.cl;

Que, el Hospital del Salvador necesita contar con un Convenio Suministro de Suplementos Nutricionales G-1 para el Hospital del Salvador con la finalidad de satisfacer de manera adecuada y eficiente la labor asistencial durante periodo de 36 meses;

